export const initialState = {
        "departureAirport": "",
        "arrivalAirport":"",
        "departureDate": "",
        "savings": "",

};

// @ts-ignore
export function menuBarReducer(state = initialState, action) {
    switch (action.type) {
        case 'SUBMIT':
            return { ...state,departureDate: action.payload.departureDate, savings: action.payload.savings };
        default:
            return state;
    }
}
